INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24015, 24, 0.0, 1, "2019/07/31 12:00:00", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 110501, 4, 0.0, "2030/12/17 14:59:59", 10021, 4, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24016, 24, 0.0, 2, "2019/07/31 12:00:00", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 110501, 4, 4.0, "2030/12/17 14:59:59", 10021, 1, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24017, 24, 0.0, 3, "2019/07/31 12:00:00", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 110501, 4, 0.0, "2030/12/17 14:59:59", 10021, 4, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24018, 24, 0.0, 4, "2019/07/31 12:00:00", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 110501, 1, 5.2, "2030/12/17 14:59:59", 10021, 2, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24019, 24, 0.0, 5, "2019/07/31 12:00:00", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 110501, 5, 4.2, "2030/12/17 14:59:59", 10021, 6, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24020, 24, 0.0, 6, "2019/07/31 12:00:00", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 110501, 2, 0.0, "2030/12/17 14:59:59", 10021, 2, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24021, 24, 0.0, 7, "2019/07/31 12:00:00", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 110501, 1, 6.4, "2030/12/17 14:59:59", 10021, 6, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24022, 24, 0.0, 8, "2019/07/31 12:00:00", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 110501, 2, 0.0, "2030/12/17 14:59:59", 10021, 2, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24023, 24, 0.0, 9, "2019/07/31 12:00:00", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 110501, 6, 10.08, "2030/12/17 14:59:59", 10021, 3, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24024, 24, 0.0, 10, "2019/07/31 12:00:00", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 110501, 1, 5.0, "2030/12/17 14:59:59", 10021, 2, 0.0, "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (24025, 24, 0.0, 11, "2019/07/31 12:00:00", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 110501, 2, 0.0, "2030/12/17 14:59:59", 10021, 2, 0.0, "カオリ（サマー）");
